class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        vowels = {'a','e','i','o','u'}
        N = len(s)
        chunk = s[:k]
        curr = 0
        for ch in chunk:
            curr += int(ch in vowels)
        res = curr
        for i in range(1, N-k+1):
            curr -= int(s[i-1] in vowels)
            curr += int(s[i+k-1] in vowels)
            res = max(res, curr)
        return res

# Main section
for s, k in [
               ('abciiidef', 3),
               ('aeiou', 2),
               ('leetcode', 3),
               ('thequickbrownfoxjumpsoverthelazydog', 7),
               ('', 5),
               ('', 17),
               ('', 23),
            ]:
    print(f's, k = {s}, {k}')
    sol = Solution()
    r = sol.maxVowels(s, k)
    print(f'r = {r}')
    print('=====================')

